path.aria-label:
log_format  log1  'IP: $remote_addr; [$time_local];\n'
        'Solicitacao: "$request"; Status: $status;\n'
        'Bytes: $body_bytes_sent;\n'
        'Referer: "$http_referer"; User_Agent: "$http_user_agent";\n'
        'Forwarded_For:  "$http_x_forwarded_for";';


# HTTP PORT 81
server {
        # Escuta na porta 81
        listen       81;
        # Aplicado apenas para o(s) domínio(s) setados
        server_name ec2-3-88-144-184.compute-1.amazonaws.com;

        # Local da pasta onde está o código do site (produção)
        root         /usr/share/nginx/html;
        index index.html;

        location / {
            # Logs
            access_log /var/log/nginx/access81.log log1;
            error_log /var/log/nginx/error81.log;
        }
}

